sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {any} params.event
 * @param {any} params.imports
 */
function handler({api, event, helpers, imports, GlideRecord}) {
    var gr = new GlideRecord('covid_results');
    gr.newRecord();
    gr.employee_id = "000000";
    gr.date_of_test = "05-09-1999";
    gr.test_results = api.state.passFail;
    gr.insert();
}
